// import the library
import { library } from '@fortawesome/fontawesome-svg-core';

// import your icons
import {faBoxingGlove as faBoxingGloveSolid } from '@fortawesome/pro-solid-svg-icons';

library.add(
    faBoxingGlove,
    faBoxingGloveRegular,
    faBoxingGloveSolid
);
